import { gql } from '@apollo/client';




export const CREATE_USER_MUTATION = gql`
  mutation createUser() {
      createUser() {}
      args: {
        firstName: { type: GraphQLString },
        lastName: { type: GraphQLString },
        email: { type: GraphQLString },
        password: { type: GraphQLString }
      },
  }


`;
